INSERT INTO `frases` (`id`, `frase`, `categoria_id`, `classe_id`, `data_criacao`) VALUES
(1, 'Fico feliz por ajudar!', 1, 1, '2024-09-10 11:52:22'),
(2, 'Você sabe onde me encontrar caso precise novamente.', 1, 1, '2024-09-10 11:52:22'),
(3, 'Você pode contar comigo sempre.', 1, 1, '2024-09-10 11:52:22'),
(4, 'Fico grato pela confiança.', 1, 1, '2024-09-10 11:52:22'),
(5, 'Disponha, estou sempre à disposição.', 1, 1, '2024-09-10 11:52:22'),
(6, 'Não foi nada, sempre que precisar!', 1, 1, '2024-09-10 11:52:22'),
(7, 'Que bom que gostou!', 1, 1, '2024-09-10 11:52:22'),
(8, 'A qualquer momento, estarei aqui.', 1, 1, '2024-09-10 11:52:22'),
(9, 'Estamos juntos nessa!', 1, 1, '2024-09-10 11:52:22'),
(10, 'Prazer em poder contribuir.', 1, 1, '2024-09-10 11:52:22'),
(11, 'Você é sempre bem-vindo.', 1, 1, '2024-09-10 11:52:22'),
(12, 'De nada.', 1, 1, '2024-09-10 11:52:22'),
(13, 'Por nada!', 1, 1, '2024-09-10 11:52:22'),
(14, 'Não foi nada.', 1, 1, '2024-09-10 11:52:22'),
(15, 'Não tem de quê.', 1, 1, '2024-09-10 11:52:22'),
(16, 'Eu que agradeço a confiança.', 1, 1, '2024-09-10 11:52:22'),
(17, 'Precisando, estou às ordens.', 1, 1, '2024-09-10 11:52:22'),
(18, 'Conte comigo!', 1, 1, '2024-09-10 11:52:22'),
(19, 'Disponha', 1, 1, '2024-09-10 11:52:22'),
(20, 'Às ordens', 1, 1, '2024-09-10 11:52:22'),
(21, 'Foi um prazer ajudá-lo!', 1, 1, '2024-09-10 11:52:22'),
(22, 'Foi um prazer ajudar.', 1, 1, '2024-09-10 11:52:22'),
(23, 'Fico à disposição!', 1, 1, '2024-09-10 11:52:22'),
(24, 'Conte sempre comigo.', 1, 1, '2024-09-10 11:52:22'),
(25, 'A satisfação é minha.', 1, 1, '2024-09-10 11:52:22'),
(26, 'Sempre que precisar!', 1, 1, '2024-09-10 11:52:22'),
(27, 'Eu que agradeço!', 1, 1, '2024-09-10 11:52:22'),
(28, 'Foi um prazer colaborar.', 1, 1, '2024-09-10 11:52:22'),
(29, 'Disponha sempre.', 1, 1, '2024-09-10 11:52:22'),
(30, 'Estou aqui para ajudar.', 1, 1, '2024-09-10 11:52:22'),
(31, 'Agradeço pela oportunidade.', 1, 1, '2024-09-10 11:52:22'),
(32, 'Espero que tenha sido útil.', 1, 1, '2024-09-10 11:52:22'),
(33, 'Fique à vontade para chamar.', 1, 1, '2024-09-10 11:52:22'),
(34, 'Fico muito grato por poder ajudar.', 1, 1, '2024-09-10 11:52:22'),
(35, 'Sempre que precisar, estarei por aqui.', 1, 1, '2024-09-10 11:52:22'),
(36, 'Estou sempre à disposição para o que der e vier.', 1, 1, '2024-09-10 11:52:22'),
(37, 'Você pode contar comigo em qualquer situação.', 1, 1, '2024-09-10 11:52:22'),
(38, 'Não foi nada, fico feliz em colaborar!', 1, 1, '2024-09-10 11:52:22'),
(39, 'O prazer foi todo meu, estou à disposição.', 1, 1, '2024-09-10 11:52:22'),
(40, 'É sempre bom poder contribuir.', 1, 1, '2024-09-10 11:52:22'),
(41, 'Conte comigo, é só chamar.', 1, 1, '2024-09-10 11:52:22'),
(42, 'A qualquer hora, só me acionar!', 1, 1, '2024-09-10 11:52:22'),
(43, 'Disponível para você, sempre que precisar.', 1, 1, '2024-09-10 11:52:22'),
(44, 'É sempre um prazer poder ajudar.', 1, 1, '2024-09-10 11:52:22'),
(45, 'Fico feliz em saber que deu tudo certo!', 1, 1, '2024-09-10 11:52:22'),
(46, 'Pode contar comigo, estou sempre disponível.', 1, 1, '2024-09-10 11:52:22'),
(47, 'Ajuda é o que faço de melhor!', 1, 1, '2024-09-10 11:52:22'),
(48, 'Sempre pronto para contribuir quando precisar.', 1, 1, '2024-09-10 11:52:22'),
(49, 'Você pode me acionar a qualquer momento.', 1, 1, '2024-09-10 11:52:22'),
(50, 'Estou sempre por perto, é só chamar.', 1, 1, '2024-09-10 11:52:22'),
(51, 'Prazer em ajudar, conte comigo para o que precisar.', 1, 1, '2024-09-10 11:52:22'),
(52, 'Tudo certo! Agora está nas suas mãos.', 1, 1, '2024-09-10 11:52:22'),
(53, 'Tranquilão, já tá resolvido!', 1, 1, '2024-09-10 11:52:22'),
(54, 'Tá feito, só chamar o próximo desafio!', 1, 1, '2024-09-10 11:52:22'),
(55, 'Valeu demais, tamo junto!', 1, 1, '2024-09-10 11:52:22'),
(56, 'Suave na nave, missão cumprida!', 1, 1, '2024-09-10 11:52:22'),
(57, 'Pega nada, só chamar de novo!', 1, 1, '2024-09-10 11:52:22'),
(58, 'Fechou, é nóis!', 1, 1, '2024-09-10 11:52:22'),
(59, 'Pode deixar, tá tudo certo!', 1, 1, '2024-09-10 11:52:22'),
(60, 'Só agradecer e vamo que vamo!', 1, 1, '2024-09-10 11:52:22'),
(61, 'Já era! Tamo junto!', 1, 1, '2024-09-10 11:52:22'),
(62, 'Segura essa, resolvido rapidinho!', 1, 1, '2024-09-10 11:52:22'),
(63, 'Não se preocupe, minha paciência é infinita (quase).', 1, 2, '2024-09-10 11:52:22'),
(64, 'Pode me chamar de novo, se eu não estiver dormindo!', 1, 2, '2024-09-10 11:52:22'),
(65, 'Você me deve um café por essa!', 1, 2, '2024-09-10 11:52:22'),
(66, 'Acho que estou ficando bom nisso!', 1, 2, '2024-09-10 11:52:22'),
(67, 'Quem diria que resolver isso seria tão fácil!', 1, 2, '2024-09-10 11:52:22'),
